	add("abasia", "{\"term\":\"abasia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027a-\u0027 (without) + Ancient greek (to 1453) \u0027βάσις\u0027 (step) + \u0027-ia\u0027 (pathological condition)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An inability to walk due to a defect in muscular coordination.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The patient is able to move her legs while lying down but has \u0027\u0027abasia\u0027\u0027 when she stands up\", \"priority\":3}]}, \"synonyms\":{}}");

	add("abasiophilia", "{\"term\":\"abasiophilia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the Greek, abasios, meaning lameness.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An overpowering sexual attraction to people who use orthopaedic appliances such as leg-braces, spinal braces, plaster or fibreglass orthopedic casts, or wheelchairs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abassi", "{\"term\":\"abassi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1765\u0027\u0027, \u0027The Modern Part of an Univerſal Hiſtory, from the Earlieſt Account of Time\u0027, volume 43 (printed in London), page 161\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The most current money in \u0027Perſia\u0027 are the \u0027\u0027abaſſi\u0027s\u0027\u0027, worth about 1 \u0027s\u0027. 4 \u0027d.\u0027 ſterling : they are of the fineſt ſilver. An \u0027\u0027abaſſi\u0027\u0027 is worth two mahmoudi\u0027s, a mahmoudi two ſhais, and a ſhai ten ſingle or five double caſbeghi\u0027s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, William Anderson, \u0027The London commercial dictionary, and sea-port gazetteer\u0027 (printed in London), page 557, entry \u0026quot;Persia\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Accounts\u0027 are kept in tomans of 50 \u0027\u0027abassis\u0027\u0027 \u003d 100 mamoodis \u003d 200 shatrees \u003d 1,000 dinars-bisti. The last is an imaginary money\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, \u0027The romances of Alexandre Dumas\u0027, chapter 13, \u0027The Miller\u0027, page 141\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Only know how to set about it, and you can extract an \u0027\u0027abassi\u0027\u0027, not from every carriage, but from every gun-barrel\", \"priority\":7}]}, \"synonyms\":{}}");

	add("abatacept", "{\"term\":\"abatacept\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fusion protein composed of an immunoglobulin fused to the extracellular domain of CTLA-4, a molecule capable of binding B7, used to treat rheumatoid arthritis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abater", "{\"term\":\"abater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abate|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, abates. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abatis", "{\"term\":\"abatis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027lang\u003dfr\u0027 \u0027lang\u003dfr\u0027 \u0026lt;span class\u003d\u0027mention-gloss-double-quote\u0027\u0026gt;\u0026quot;\u0026lt;/span\u0026gt;mass of things beaten or cut down\u0026lt;span class\u003d\u0027mention-gloss-double-quote\u0027\u0026gt;\u0026quot;\u0026lt;/span\u0026gt;, from \u0027\u0027 See \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A means of defense formed by felled trees, or sometimes by bent trees, the ends of whose branches are sharpened and directed outwards, or against the enemy, and more recently fortified with barbed wire. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abatjour", "{\"term\":\"abatjour\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027abat-jour\u0027 from \u0027abattre\u0027 (to throw down) + \u0027jour\u0027 (day, daylight)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A skylight or other device whose purpose is to direct light into a room\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abattoir", "{\"term\":\"abattoir\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|abattoir|lang\u003den}}, from \u0027abattre\u0027 (to slaughter) (cognate to \u0027abate\u0027 + \u0027-oir\u0027 (-ory)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public slaughterhouse for cattle, sheep, etc. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A place likened to a slaughterhouse.\u0026lt;ref\u0026gt;American Heritage Dictionary of the English Language, Fourth Edition\u0026lt;/ref\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abature", "{\"term\":\"abature\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027abatture\u0027 \u0027abatre\u0027 (to knock down, to destroy) See abate\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Grass and sprigs beaten or trampled down by a stag passing through them. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abaza", "{\"term\":\"abaza\", \"etymology\":{\"influencers\":[], \"languages\":[\"abaza\", \"English\", \"Russian\"], \"text\":\"From Abaza \u0027абаза\u0027 See Russian \u0027абазин\u0027 for more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Northwest Caucasian language spoken in the Russian autonomous republic of Karachay-Cherkessia, in the Caucasus Mountains, as well as in Turkey. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

